import React, { Component } from "react";
import Slider from "react-slick";
class Carousel extends Component {
  render() {
    const settings = {
      fade: true,
      arrows: true,
      dots: true,
      infinite: true,
      autoplay: true,
      speed: 1000,
      slidesToShow: 1,
      slidesToScroll: 1,
      autoplaySpeed: 1300,
      stopOnHover: true,
      centerMode: true
    };
    return (
      <div>
        <section className="center">
          <Slider {...settings}>
            <div className="center">
              <img className="slide" src="/images/front.jpg" alt={"pic"} />
            </div>
            <div className="center">
              <img className="slide" src="/images/side.jpg" alt={"pic"} />
            </div>
          </Slider>
        </section>
      </div>
    );
  }
}

export default Carousel;
